const LOGO_URI = "data:image/png;base64,"

const COLOURS = {
  "red": "#ff0000",
  "green": "#01622e"
}

let logo_uri = ""
let change_timer = 0
let advanced_controls = false
let current_label = null

const get_saved_labels = () => {
  let saved = [];
  if(localStorage["labels"]) {
    saved = JSON.parse(localStorage["labels"]);
  }
  return saved.filter(l => l.label.name === current_label.name)
}

const load_label = (label) => {
  current_label = label.label;
  render_form()
  current_label.fields.forEach(field => {
    $("#" + field.name).val(label.values[field.name].replace(/<br>/g, "\n"));
  });
  render_preview()
}

const save_label = () => {
  let saved = []
  if(localStorage["labels"]) {
    saved = JSON.parse(localStorage["labels"]);
  }
  const values = field_values()
  const new_label = {
    label: current_label,
    values: values,
    id: values.title + '-' + Date() + '-' + (Math.random() * 10000000000000000)
  }
  saved.push(new_label)
  localStorage["labels"] = JSON.stringify(saved);
  $("#saved-list").append(render_label_for_saved(new_label))
  $("#store h5").show();
}

const delete_label = (id) => {
  const saved = JSON.parse(localStorage["labels"])
  localStorage["labels"] = JSON.stringify(saved.filter(l => l.id !== id))
  render_saved()
}

const render_label_for_saved = (label) => {
  const li = $('<li class="saved-label">')
  li.text(label.values.title)
  const left_group = $(`<div class="btn-group">`)
  const show_btn = $(`<button class="btn btn-sm btn-outline-primary">`)
  show_btn.html(`<i class="far fa-eye"></i>`)
  show_btn.on("click", ev => load_label(label))
  left_group.append(show_btn)
  const download_btn = $(`<a class="btn btn-sm btn-outline-primary">`)
  download_btn.html(`<i class="fas fa-download"></i>`)
  download_btn.attr("href", "data:text/json;charset=utf-8," + encodeURIComponent(JSON.stringify(label)))
  download_btn.attr("download", label.values.title + ".cml")
  left_group.append(download_btn)
  li.append(left_group)
  const delete_btn = $(`<button class="btn btn-sm btn-outline-danger">`)
  delete_btn.html(`<i class="far fa-trash-alt"></i>`)
  delete_btn.on("click", ev => delete_label(label.id))
  li.append(delete_btn)
  return li
}

const render_saved = () => {
  $("#saved-list").html("")
  const saved = get_saved_labels()
  if (saved.length === 0){
    $("#store h5").hide();
  } else {
    $("#store h5").show();
  }
  saved.forEach((l, i) => {
    $("#saved-list").append(render_label_for_saved(l))
  })
}

const render_form = () => {
  let label = current_label
  $("#label-form").html(
    label.fields
      .filter(f => f.type == "input")
      .map(
        f => `
<div class="form-group" id="fg_${f.name}">
  <label for="${f.name}">${f.label}</label>
  <${f.multiline? 'textarea' : 'input type="text" value="' + f.placeholder + '"'} 
    id="${f.name}" 
    class="form-control"
  >${f.multiline? f.placeholder + '</textarea>' : ''}
</div>`
      )
  )
  $("#label-form input, #label-form textarea").on("keyup", () => {
    clearTimeout(change_timer)
    change_timer = setTimeout(() => {
      render_preview();
    }, 500);
  })
  render_saved()
};

const render_advanced_controls = () => {
  if (!advanced_controls) {
    $(".advanced-controls").slideUp("fast", function() {$(this).remove()})
    return
  }
  let label = current_label
  label.fields
      .filter(f => f.type == "input")
      .map(f => {
    $("#fg_" + f.name).append(`
<div class="advanced-controls" data-name="${f.name}" style="display:none;">
Nudge: <div class="btn-group">
    <button class="btn btn-sm btn-nudge btn-outline-dark">
      <i class="fas fa-arrow-down"></i>
    </button>
    <button class="btn btn-sm btn-nudge btn-outline-dark" data-dir="up">
      <i class="fas fa-arrow-up"></i>
    </button> 
  </div>
Text Size: <div class="btn-group">
    <button class="btn btn-sm btn-size btn-outline-dark">
      <i class="fas fa-minus"></i>
    </button>
    <button class="btn btn-sm btn-size btn-outline-dark" data-dir="up">
      <i class="fas fa-plus"></i>
    </button> 
  </div>
</div>
`)
  })
  $(".advanced-controls").slideDown("fast")
  $(".btn-nudge").on("click", function() {
    let name = $(this).parent().parent().attr("data-name")
    label.fields.find(f => f.name === name).y += $(this).attr("data-dir") == 'up' ? -0.5 : 0.5
    render_preview()
  })
  $(".btn-size").on("click", function() {
    let name = $(this).parent().parent().attr("data-name")
    label.fields.find(f => f.name === name).font_size += $(this).attr("data-dir") == 'up' ? 0.5 : -0.5
    render_preview()
  })
}

const render_preview = () => {
  let label = current_label
  if(label.circular){
    $("#preview").addClass("circular")
  } else {
    $("#preview").removeClass("circular")
  }
  const fields = field_values();
  $("#preview")
    .show()
    .css({
      width: label.width + "mm",
      height: label.height + "mm"
    })
    .html(
      label.fields.map(
        field => `
<div 
  id="preview_${field.name}" 
  class="field ${field.x ? "" : "centered"}" 
  style="top:${field.y}mm; font-size:${field.font_size}pt; 
        ${
          field.x ? (field.align === "right" ? "right:" : "left:") + field.x + "mm" : ""
        }; ${
          field.font_weight ? "font-weight:" + field.font_weight : ""
        }; ${
          field.font_color ? "color:" + COLOURS[field.font_color] : ""
        }; ${
          field.align ? "text-align:" + field.align : ""
        }; ${
          field.width ? "width:" + field.width + "mm": ""
        }; ${
          field.font_family ? "font-family:" + field.font_family: ""
        };"
>
  ${field.transform ? TRANSFORMS[field.transform](fields[field.name]) : fields[field.name]}
</div>`
      )
    );
  if (logo_uri) {
    $("#preview").append(`
<div class="logo" style="top:${label.logo.y}mm; left:${label.logo.x}mm;">
<img 
  id="logo" 
  src="${logo_uri}" 
  alt="logo" 
  style="width:${label.logo.width}mm; height:${label.logo.height}mm"
>
</div>`);
  }
  label.fields
    .filter(f => f.type == "input")
    .forEach(field => {
      if (
        Math.round($("#preview_" + field.name)[0].scrollWidth) >
        Math.round($("#preview_" + field.name).innerWidth())
      ) {
        $("#" + field.name).addClass("is-invalid");
        $("#preview_" + field.name).addClass("text-danger");
      } else {
        $("#" + field.name).removeClass("is-invalid");
        $("#preview_" + field.name).removeClass("text-danger");
      }
    });
  if ($(".is-invalid").length) {
    $("#print").attr("disabled", true);
    $("#error")
      .show()
      .text("Some lines of text are too long");
  } else {
    $("#print")
      .attr("disabled", false);
    $("#error").hide();
  }
};

const origins = () => {
  let label = current_label
  const label_origins = [];
  const offset = parseInt($("#input_offset").val())
  const total_count = parseInt($("#input_count").val()) + offset
  let counter = 0
  for (let j = 0; j < label.rows; j++) {
    for (let i = 0; i < label.columns; i++) {
      counter += 1
      if (counter <= offset || counter > total_count) {
        continue
      }
      label_origins.push({
        x: label.origin_x + i * (label.width + (label.margin_x || 0)),
        y: label.origin_y + j * (label.height + (label.margin_y || 0))
      });
    }
  }
  return label_origins;
};

const field_values = () => {
  const fields = {};
  current_label.fields.forEach(field => {
    if (field.type == "fixed") {
      fields[field.name] = field.value;
    } else {
      fields[field.name] = $("#" + field.name).val();
    }
    if (field.multiline) {
      fields[field.name] = fields[field.name].replace(/\n/g, "<br>");
    }
  });
  return fields;
};

const print = () => {
  if($("#input_count").hasClass("is-invalid")) {
    alert("The offset plus the number of labels you want to print is more than will fit onto one page.")
    return
  }
  let label = current_label
  const doc = new jsPDF()
  doc.setFont("helvetica")
  const fields = field_values();
  origins().forEach(origin => {
    label.fields.forEach(field => {
      doc.setFontSize(field.font_size);
      doc.setFontStyle(field.font_weight || "normal")
      doc.setTextColor(COLOURS[field.font_color] || "#000000")
      if(field.font_family) {
        doc.setFont(field.font_family)
      } else {
        doc.setFont("helvetica")
      }
      const x = field.align === "right" ? label.width - field.x : field.x
      const value = fields[field.name].replace(/<br>/g, "\n")
      doc.text(
        field.transform ? TRANSFORMS[field.transform](value).replace("<br>", "\n") : value,
        field.x ? origin.x + x : origin.x + label.width / 2,
        origin.y + field.y,
        {
          baseline: "top",
          align: field.align ? field.align : "center",
          lineHeightFactor: 1,
          maxWidth: field.width || 0
        }
      );
    });
    if (logo_uri) {
      const file_type = logo_uri.split(";")[0].split("/")[1];
      doc.addImage(
        logo_uri,
        file_type,
        origin.x + label.logo.x,
        origin.y + label.logo.y,
        label.logo.width,
        label.logo.height
      )
    }
  })
  doc.save(label.name + ".pdf")
}

const render_options = () => {
  $("#select").show()
  $("#main").hide()
}

const render_label_form = () => {
  render_form()
  $("#select").hide()
  $("#main").show()
  $("#input_count").val(current_label.rows * current_label.columns)
  $("#input_offset").val(0)
  if(!current_label.logo.fixed){
    const reader = new FileReader();

    reader.addEventListener(
      "load",
      () => {
        logo_uri = reader.result;
        render_preview();
      },
      false
    );
    $("#logo-form").show()
    $("#logo_input")
      .off()
      .on("change", () => {
        const file = $("#logo_input").prop("files")[0];
        if (file) {
          reader.readAsDataURL(file);
        }
      })
  } else {
    $("#logo-form").hide()
    logo_uri = LOGO_URI
  }
  render_preview();
  $("#print")
    .off()
    .on("click", () => print());
  if(advanced_controls) {
    render_advanced_controls()
  }
}

const check_total_counts = () => {
  const offset = parseInt($("#input_offset").val())
  const total_count = parseInt($("#input_count").val())
  console.log(offset, total_count, offset + total_count, (current_label.rows * current_label.columns))
  if ((offset + total_count) > (current_label.rows * current_label.columns)) {
    $("#input_count").addClass("is-invalid")
    $("#input_offset").addClass("is-invalid")
  } else {
    $("#input_count").removeClass("is-invalid")
    $("#input_offset").removeClass("is-invalid")
  }
}

$(document).ready(() => {

  $("#back").on("click", () => {
    render_options()
  })
  $("#input_count").on("change", check_total_counts)
  $("#input_offset").on("change", check_total_counts)
  $("head").append(
    `<style>${Object.keys(COLOURS).map(k => {return "." + k + "{color:" + COLOURS[k] + "}"})}</style>`
  )
  Object.keys(labels).forEach(l => {
    $('#labels').append(`
    <button type="button" data_type="${l}" class="label-select btn btn-default btn-lg">
      ${labels[l].name}
    </button>`)
  })
  render_options()
  $(".label-select").on("click", function() {
    current_label = labels[$(this).attr("data_type")]
    render_label_form()
  })
  $("#advanced-controls").on("change", event => {
    advanced_controls = $("#advanced-controls").is(":checked")
    render_advanced_controls()
  })
  $("#save-label").on("click", save_label)
  $("#load-label").on("click", () => {
    document.getElementById('file-upload').click();
  })
  $("#file-upload").on("change", () => {
    const files = $('#file-upload').prop('files');
    if (files.length === 0) {
      return
    }
    const file = files[0]
    const fr = new FileReader()
    fr.onload = function () {
      const label = JSON.parse(fr.result)
      if (label.label.name !== current_label.name) {
        alert("Wrong type of label selected, must be " + label.label.name);
        return
      }
      load_label(label)
    }
    fr.readAsText(file)
  })
})
